import React from "react";
import FunnelGraph from "./FunnelGraph";

const data = {
    labels: ["Perfil PFAE", "Doc INE", "Domicilio", "Doc Constancia", "Firma Contrato"],
    subLabels: ["Persona PFAE"],
    colors: [["#7bc62d", "#e0edd5"]],
    values: [1294,954,615,248,123]
};


const Funnel: React.FC = () => {
    return (
        <div className="App">
            <FunnelGraph data={data} width={1000} height={350} />
        </div>
    );
}

export default Funnel;
